import { Link } from 'react-router-dom';
import Logement from '../pages/Logement';

function LogementHome(props) {
   console.log(props);

   const [datalogement, setDataLogement] = useState();

   useEffect(() => {
       fetch('http://localhost:3000/fichier.json', {
           headers : { 
             'Content-Type': 'application/json',
             'Accept': 'application/json'
            }})
       .then(response => {
        return response.json()
       })
       .then(data => {
        setDataLogement(data)
       })
   }, [])

    return (
        <Link to={`fiche_logement?${props.title.id}`} state='tonio cartonio'><div className='container-logement-home'>
        <p>{props.title.title}</p>
    </div></Link>
    );
}

export default LogementHome;
